%% This script takes the list of subjects' filenames used in Yoni's back pain analysis, extracts the subject ids,
% links those ids with URSIs, and saves a table with a row for each id-URSI combination for participants to use in
% the univariate back pain analysis.


% import repos and folders 
addpath(genpath('/dartfs-hpc/rc/home/1/f0040y1/repositories/CanlabCore'));
path_to_repos = '/dartfs-hpc/rc/home/1/f0040y1/repositories/';
savepath = '/dartfs-hpc/rc/home/1/f0040y1/CANlab/labdata/projects/OLP4CBP/hyperalignment/scripts/parcelwise_ha/glm';

% get list of subjects filenames
subids = get_sub_list;
subids = subids(:, 58:61); % get only subids from string

% load full metadata table from yoni
load(fullfile(path_to_repos, 'OLP4CBP', 'data','subject_metadata.mat'));

% get URSIs corresponding to subids from metadata table subIDs
indxs = [];
for i = 1:length(subids)
    wh = find(tabl.id == str2num(subids(i,:)));
    indxs = [indxs wh(1)]; % only need first to get ursi, it's same for both time points
end
URSI = tabl.URSI(indxs,:); % get URSIs

% put both variables into table
univariate_subject_table = table(subids);
univariate_subject_table.URSI = URSI;

% save to glm analysis repo
save(fullfile(savepath, 'univariate_subject_table.mat'), 'univariate_subject_table');
writetable(univariate_subject_table,'univariate_subject_table.csv','Delimiter',',');



